"use strict";

const {defaultDict} = require('defaultdict');
const f_gold = (s, sub, mappings) => {
    const d = defaultDict(() => new Set());
    for (let [a, b] of mappings) {
        d[a].add(b);
    }
    const n = s.length, k = sub.length;
    for (let i = 0; i < n - k + 1; i++) {
        let flag = true;
        for (let j = 0; j < k; j++) {
            const [a, b] = [s[i + j], sub[j]];
            if (a === b || d[b].has(a)) {
                continue;
            } else {
                flag = false;
                break;
            }
        }
        if (flag) {
            return true;
        }
    }
    return false;
};
